import React from "react";
import "./levels.css";
//get the pwrData from pwr.js
import { pwrData } from "./pwr.js";

const Head = () => {
    return (
      <header className="header">
        <h2>Sanitizer Power Levels</h2>
      </header>
    );
  };

export const Battery = () => {
    return (
      <>
        <Head/>
        <div className="powerLevels">
          {pwrData.map((data, key) => {
            return (
              <div key={key}>
                <Device
                  key={key}
                  Device={data.DeviceID}
                  Battery={data.pwrLevel}
                />
              </div>
            );
          })}
        </div>
      </>
    );
  };
  
 
  
  const Device = ({ DeviceID, pwrLevel}) => {
    return (
<>    
<table>
      <tbody>
        <tr>
          <td>
              {DeviceID}
              </td>
          <td>
         
              <h5>{pwrLevel}</h5>
              </td>
              </tr>
      </tbody>
    </table>
</>
    );
  };
